pragma solidity ^0.4.19;

contract CarreraDeCaballos {

    struct Caballo {
        address id; //address;
        string nombreCaballo;
        string nombreJinete;
        uint edadCaballo;
        uint edadJinete;
        uint carrerasGanadas;
        uint carrerasTotales;
    }

    uint contador = 0;
    uint randNonce = 0;
    
    
    Caballo[] public caballos;

    mapping (address => uint) public numeroCaballosPersona;


    modifier restriccion() {
        require(numeroCaballosPersona[msg.sender] < 1, "Solo se puede aÃ±adir un caballo por persona");
        _;
    }

    function crearCaballo(string _nombreCaballo, string _nombreJinete, uint _edadCaballo, uint _edadJinete) public restriccion returns (uint) {
        caballos.push(Caballo(msg.sender, _nombreCaballo, _nombreJinete, _edadCaballo, _edadJinete, 0, 0));
        numeroCaballosPersona[msg.sender]++;
        contador++;
        return contador;
    }

   function randMod() internal returns(uint) {
    // increase nonce
    randNonce++; 
    return uint(keccak256(abi.encodePacked(now, caballos.length, randNonce))) % 100;
    }
    

}
